import Footer from "../Footer/Footer";
import NavBar from "../NavBar/Navbar";
import ContactForm from "./ContactForm";

const Contact = () => {
  return (
    <div>
      <NavBar />
      <ContactForm />
      <Footer />
    </div>
  );
};

export default Contact;
